import React from 'react';
import DayJS from 'react-dayjs';

<DayJS format="MM-DD-YYYY">2000-01-31T11:59:00-05:00</DayJS>


const Header = () => {
  return (
    <header>
        <h1>Grocery List</h1>
        <p>Date/Time</p>
    </header>
  );
}

export default Header;
